import{_ as e,c as l,o as a,e as t}from"./app.221c0c1b.js";const Q='{"title":"\u0418\u043D\u0442\u0435\u0433\u0440\u0430\u043B\u044C\u043D\u044B\u0439 \u043F\u043E\u0434\u0445\u043E\u0434","description":"","frontmatter":{"title":"\u0418\u043D\u0442\u0435\u0433\u0440\u0430\u043B\u044C\u043D\u044B\u0439 \u043F\u043E\u0434\u0445\u043E\u0434","subtitle":"\u041A\u0435\u043D \u0423\u0438\u043B\u0431\u0435\u0440","tags":"synopsis"},"headers":[{"level":2,"title":"AQAL","slug":"aqal"}],"relativePath":"synopsis/integral/index.md"}',i={},s=t('<h2 id="aqal" tabindex="-1">AQAL <a class="header-anchor" href="#aqal" aria-hidden="true">#</a></h2><p>AQAL (\u043F\u0440\u043E\u0438\u0437\u043D\u043E\u0441\u0438\u0442\u0441\u044F [\u0430\u0301\u043A\u0432\u0430\u043B])\u2009\u2014\u2009\u0442\u0435\u0440\u043C\u0438\u043D, \u043F\u0440\u0435\u0434\u043B\u043E\u0436\u0435\u043D\u043D\u044B\u0439 \u041A\u0435\u043D\u043E\u043C \u0423\u0438\u043B\u0431\u0435\u0440\u043E\u043C \u0434\u043B\u044F \u043E\u0431\u043E\u0437\u043D\u0430\u0447\u0435\u043D\u0438\u044F \u0440\u0430\u0437\u0440\u0430\u0431\u043E\u0442\u0430\u043D\u043D\u043E\u0439 \u0438\u043C \u0438\u043D\u0442\u0435\u0433\u0440\u0430\u043B\u044C\u043D\u043E\u0439 \u0441\u0438\u0441\u0442\u0435\u043C\u044B \u043A\u043E\u043E\u0440\u0434\u0438\u043D\u0430\u0442, \u043A\u043E\u0442\u043E\u0440\u0430\u044F \u043F\u043E\u0437\u0432\u043E\u043B\u044F\u0435\u0442 \u043E\u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043B\u044F\u0442\u044C \u043C\u0435\u0442\u0430\u043F\u0430\u0440\u0430\u0434\u0438\u0433\u043C\u0430\u0442\u0438\u0447\u0435\u0441\u043A\u0438\u0439 \u0438 \u043F\u043E\u0441\u0442\u0434\u0438\u0441\u0446\u0438\u043F\u043B\u0438\u043D\u0430\u0440\u043D\u044B\u0439 \u0441\u0438\u043D\u0442\u0435\u0437 \u0440\u0430\u0437\u043B\u0438\u0447\u043D\u044B\u0445 (\u043F\u043E\u0442\u0435\u043D\u0446\u0438\u0430\u043B\u044C\u043D\u043E \u043B\u044E\u0431\u044B\u0445) \u043C\u0435\u0442\u043E\u0434\u043E\u0432 \u0438 \u043E\u0431\u043B\u0430\u0441\u0442\u0435\u0439 \u0447\u0435\u043B\u043E\u0432\u0435\u0447\u0435\u0441\u043A\u043E\u0439 \u0434\u0435\u044F\u0442\u0435\u043B\u044C\u043D\u043E\u0441\u0442\u0438.</p><p>\u0410\u043A\u0440\u043E\u043D\u0438\u043C \xABAQAL\xBB \u044F\u0432\u043B\u044F\u0435\u0442\u0441\u044F \u0441\u043E\u043A\u0440\u0430\u0449\u0435\u043D\u0438\u0435\u043C \u043E\u0442 \xAB\u0432\u0441\u0435 \u043A\u0432\u0430\u0434\u0440\u0430\u043D\u0442\u044B, \u0432\u0441\u0435 \u0443\u0440\u043E\u0432\u043D\u0438, \u0432\u0441\u0435 \u043B\u0438\u043D\u0438\u0438, \u0432\u0441\u0435 \u0441\u043E\u0441\u0442\u043E\u044F\u043D\u0438\u044F, \u0432\u0441\u0435 \u0442\u0438\u043F\u044B\xBB (\u0430\u043D\u0433\u043B. all quadrants, all levels, all lines, all states, all types). AQAL-\u043F\u043E\u0434\u0445\u043E\u0434 \u043B\u0435\u0436\u0438\u0442 \u0432 \u043E\u0441\u043D\u043E\u0432\u0430\u043D\u0438\u0438 \u0442\u0435\u043A\u0443\u0449\u0435\u0439 \u0432\u0435\u0440\u0441\u0438\u0438 \u0440\u0430\u0437\u0432\u0438\u0432\u0430\u0435\u043C\u043E\u0439 \u0423\u0438\u043B\u0431\u0435\u0440\u043E\u043C \u0438 \u0435\u0433\u043E \u043A\u043E\u043B\u043B\u0435\u0433\u0430\u043C\u0438 \u043E\u0431\u043B\u0430\u0441\u0442\u0438, \u0438\u0437\u0432\u0435\u0441\u0442\u043D\u043E\u0439 \u043A\u0430\u043A \u0438\u043D\u0442\u0435\u0433\u0440\u0430\u043B\u044C\u043D\u0430\u044F (\u043C\u0435\u0442\u0430)\u0442\u0435\u043E\u0440\u0438\u044F \u0438 \u043F\u0440\u0430\u043A\u0442\u0438\u043A\u0430.</p><p>\u0422\u0435\u043E\u0440\u0435\u0442\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0438\u0441\u0441\u043B\u0435\u0434\u043E\u0432\u0430\u043D\u0438\u044F \u0423\u0438\u043B\u0431\u0435\u0440\u0430 \u0432\u044B\u0437\u0432\u0430\u043B\u0438 \u0437\u043D\u0430\u0447\u0438\u0442\u0435\u043B\u044C\u043D\u044B\u0439 \u0438\u043D\u0442\u0435\u0440\u0435\u0441 \u043D\u0435 \u0442\u043E\u043B\u044C\u043A\u043E \u0432 \u0421\u0428\u0410, \u043D\u043E \u0438 \u043F\u043E \u0432\u0441\u0435\u043C\u0443 \u043C\u0438\u0440\u0443. \u0418\u0441\u0441\u043B\u0435\u0434\u043E\u0432\u0430\u0442\u0435\u043B\u0438 \u0438 \u043F\u0440\u0430\u043A\u0442\u0438\u043A\u0438 \u0438\u043D\u0442\u0435\u0433\u0440\u0430\u043B\u044C\u043D\u043E\u0433\u043E \u043F\u043E\u0434\u0445\u043E\u0434\u0430, \u043E\u0441\u043D\u043E\u0432\u0430\u043D\u043D\u043E\u0433\u043E \u043D\u0430 AQAL-\u043C\u043E\u0434\u0435\u043B\u0438, \u0435\u0441\u0442\u044C \u043F\u0440\u0430\u043A\u0442\u0438\u0447\u0435\u0441\u043A\u0438 \u0432\u043E \u0432\u0441\u0435\u0445 \u043E\u0441\u043D\u043E\u0432\u043D\u044B\u0445 \u0441\u0442\u0440\u0430\u043D\u0430\u0445 \u043C\u0438\u0440\u0430.</p><p>\u0411\u0430\u0437\u043E\u0432\u0443\u044E \u0438\u0434\u0435\u044E AQAL-\u043C\u0435\u0442\u0430\u043F\u043E\u0434\u0445\u043E\u0434\u0430 \u043C\u043E\u0436\u043D\u043E \u043E\u0431\u043E\u0431\u0449\u0438\u0442\u044C \u0441\u043B\u0435\u0434\u0443\u044E\u0449\u0438\u043C \u043E\u0431\u0440\u0430\u0437\u043E\u043C: \u043B\u044E\u0431\u043E\u0439 \u043E\u0442\u0434\u0435\u043B\u044C\u043D\u043E \u0432\u0437\u044F\u0442\u044B\u0439 \u043F\u043E\u0434\u0445\u043E\u0434, \u043A\u043E\u0442\u043E\u0440\u044B\u0439 \u0441\u0442\u0440\u0435\u043C\u0438\u0442\u0441\u044F \u0431\u044B\u0442\u044C \u043F\u043E-\u043D\u0430\u0441\u0442\u043E\u044F\u0449\u0435\u043C\u0443 \u0446\u0435\u043B\u043E\u0441\u0442\u043D\u044B\u043C, \u0445\u043E\u043B\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043A\u0438\u043C, \u0438\u043B\u0438 \u0432\u0441\u0435\u043E\u0431\u044A\u0435\u043C\u043B\u044E\u0449\u0438\u043C, \u043E\u0431\u044F\u0437\u0430\u0442\u0435\u043B\u044C\u043D\u043E \u0434\u043E\u043B\u0436\u0435\u043D \u0437\u0430\u0434\u0435\u0439\u0441\u0442\u0432\u043E\u0432\u0430\u0442\u044C\u2009\u2014\u2009\u0438\u043B\u0438 \u0445\u043E\u0442\u044F \u0431\u044B \u043F\u0440\u0438\u043D\u0438\u043C\u0430\u0442\u044C \u0432 \u0440\u0430\u0441\u0447\u0451\u0442\u2009\u2014\u2009\u0432\u0441\u0435 \u044D\u043B\u0435\u043C\u0435\u043D\u0442\u044B \u0438 \u0444\u0430\u043A\u0442\u043E\u0440\u044B, \u0432\u0445\u043E\u0434\u044F\u0449\u0438\u0435 \u0432 AQAL-\u043C\u043E\u0434\u0435\u043B\u044C (\u0442\u043E \u0435\u0441\u0442\u044C \u0447\u0435\u0442\u044B\u0440\u0435 \u043A\u0432\u0430\u0434\u0440\u0430\u043D\u0442\u0430, \u0432\u0441\u0435 \u0443\u0440\u043E\u0432\u043D\u0438 \u0438 \u043B\u0438\u043D\u0438\u0438 \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u044F, \u0432\u0441\u0435 \u0441\u043E\u0441\u0442\u043E\u044F\u043D\u0438\u044F \u0438 \u0432\u0441\u0435 \u0442\u0438\u043F\u044B). \u041A\u0430\u043A \u043F\u0440\u0430\u0432\u0438\u043B\u043E, \u043A\u043E\u043D\u0432\u0435\u043D\u0446\u0438\u043E\u043D\u0430\u043B\u044C\u043D\u044B\u0435 \u043D\u0435\u0438\u043D\u0442\u0435\u0433\u0440\u0430\u043B\u044C\u043D\u044B\u0435 \u043F\u043E\u0434\u0445\u043E\u0434\u044B \u0444\u043E\u043A\u0443\u0441\u0438\u0440\u0443\u044E\u0442\u0441\u044F \u0442\u043E\u043B\u044C\u043A\u043E \u043D\u0430 \u043E\u0434\u043D\u043E\u043C \u0438\u043B\u0438 \u0434\u0432\u0443\u0445 \u044D\u043B\u0435\u043C\u0435\u043D\u0442\u0430\u0445, \u0443\u043F\u0443\u0441\u043A\u0430\u044F \u043E\u0441\u0442\u0430\u043B\u044C\u043D\u044B\u0435 \u0438\u0437 \u0432\u0438\u0434\u0443 \u0438\u043B\u0438 \u0436\u0435 \u043E\u0431\u044A\u044F\u0432\u043B\u044F\u044F \u0438\u0445 \xAB\u043D\u0435\u0437\u043D\u0430\u0447\u0438\u043C\u044B\u043C\u0438\xBB.</p><p>\u0421\u043E\u0432\u043E\u043A\u0443\u043F\u043D\u043E\u0441\u0442\u044C \u0432\u0441\u0435\u0445 \u044D\u0442\u0438\u0445 \u043F\u0430\u0440\u0430\u043C\u0435\u0442\u0440\u043E\u0432, \u0432\u0437\u044F\u0442\u044B\u0445 \u0432 \u0446\u0435\u043B\u043E\u043C, \u0438\u0437\u0432\u0435\u0441\u0442\u043D\u0430 \u043A\u0430\u043A \xABAQAL-\u043C\u0430\u0442\u0440\u0438\u0446\u0430\xBB (\u0438\u043B\u0438 \xAB\u043C\u0430\u0442\u0440\u0438\u0446\u0430 AQAL\xBB). \u041E\u0434\u043D\u043E\u0432\u0440\u0435\u043C\u0435\u043D\u043D\u043E\u0435 \u043E\u0441\u043E\u0437\u043D\u0430\u0432\u0430\u043D\u0438\u0435 \u0438 \u0437\u0430\u0434\u0435\u0439\u0441\u0442\u0432\u043E\u0432\u0430\u043D\u0438\u0435 \u043F\u043E\u043B\u043D\u043E\u0439 AQAL-\u043C\u0430\u0442\u0440\u0438\u0446\u044B \u043F\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043B\u044F\u0435\u0442 \u0441\u043E\u0431\u043E\u0439 \u0441\u0443\u0449\u043D\u043E\u0441\u0442\u044C \u0443\u0438\u043B\u0431\u0435\u0440\u043E\u0432\u0441\u043A\u043E\u0433\u043E \u0438\u043D\u0442\u0435\u0433\u0440\u0430\u043B\u044C\u043D\u043E\u0433\u043E \u0432\u0438\u0434\u0435\u043D\u0438\u044F \u0438 \u0438\u0437\u0432\u0435\u0441\u0442\u043D\u043E \u043A\u0430\u043A \u0438\u043D\u0442\u0435\u0433\u0440\u0430\u043B\u044C\u043D\u044B\u0439 \u043C\u0435\u0442\u043E\u0434\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0439 \u043F\u043B\u044E\u0440\u0430\u043B\u0438\u0437\u043C. \u041F\u043E\u0434\u043E\u0431\u043D\u044B\u0439 \u0438\u043D\u0442\u0435\u0433\u0440\u0430\u043B\u044C\u043D\u044B\u0439\u2009\u2014\u2009\u0442\u043E \u0435\u0441\u0442\u044C \u0438\u0441\u0447\u0435\u0440\u043F\u044B\u0432\u0430\u044E\u0449\u0438\u0439, \u043D\u0435\u0440\u0435\u0434\u0443\u043A\u0446\u0438\u043E\u043D\u0438\u0441\u0442\u0441\u043A\u0438\u0439, \u043E\u0441\u043D\u043E\u0432\u044B\u0432\u0430\u044E\u0449\u0438\u0439\u0441\u044F \u043D\u0430 \u0446\u0435\u043B\u043E\u0441\u0442\u043D\u043E\u0441\u0442\u0438\u2009\u2014\u2009\u043F\u043E\u0434\u0445\u043E\u0434 \u043C\u043E\u0436\u0435\u0442 \u043F\u0440\u0438\u043C\u0435\u043D\u044F\u0442\u044C\u0441\u044F \u043A \u043B\u044E\u0431\u043E\u0439 \u0447\u0435\u043B\u043E\u0432\u0435\u0447\u0435\u0441\u043A\u043E\u0439 \u0434\u0438\u0441\u0446\u0438\u043F\u043B\u0438\u043D\u0435: \u043D\u0435 \u0442\u043E\u043B\u044C\u043A\u043E \u043A \u043F\u0441\u0438\u0445\u043E\u043B\u043E\u0433\u0438\u0438 \u0438 \u043F\u0441\u0438\u0445\u043E\u0442\u0435\u0440\u0430\u043F\u0438\u0438, \u043D\u043E \u0442\u0430\u043A\u0436\u0435 \u0438 \u043A \u0431\u0438\u0437\u043D\u0435\u0441\u0443 \u0438 \u043E\u0440\u0433\u0430\u043D\u0438\u0437\u0430\u0446\u0438\u043E\u043D\u043D\u043E\u043C\u0443 \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u044E, \u044D\u043A\u043E\u043D\u043E\u043C\u0438\u043A\u0435, \u044E\u0440\u0438\u0441\u043F\u0440\u0443\u0434\u0435\u043D\u0446\u0438\u0438, \u0441\u043E\u0446\u0438\u043E\u043B\u043E\u0433\u0438\u0438, \u043F\u043E\u043B\u0438\u0442\u0438\u043A\u0435 \u0438 \u0430\u0434\u043C\u0438\u043D\u0438\u0441\u0442\u0440\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u044E, \u0441\u043F\u043E\u0440\u0442\u0443, \u044D\u043A\u043E\u043B\u043E\u0433\u0438\u0438, \u0434\u0443\u0445\u043E\u0432\u043D\u043E\u0441\u0442\u0438 \u0438 \u0442. \u0434.</p><p>\u041C\u0430\u0442\u0440\u0438\u0446\u0430 AQAL \u043F\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043B\u044F\u0435\u0442 \u0441\u043E\u0431\u043E\u0439 \u0434\u0438\u043D\u0430\u043C\u0438\u0447\u0435\u0441\u043A\u043E\u0435 \u0438 \u0431\u0435\u0441\u0448\u043E\u0432\u043D\u043E\u0435, \u0446\u0435\u043B\u044C\u043D\u043E\u0435 \u043F\u043E\u043B\u0435\u2009\u2014\u2009\u043F\u0440\u043E\u0441\u0442\u0440\u0430\u043D\u0441\u0442\u0432\u043E \u0442\u0435\u0442\u0440\u0430\u044D\u0432\u043E\u043B\u044E\u0446\u0438\u0438, \u0432 \u043A\u043E\u0442\u043E\u0440\u043E\u043C \u0447\u0435\u0442\u044B\u0440\u0435 \u043A\u0432\u0430\u0434\u0440\u0430\u043D\u0442\u0430 \u044F\u0432\u043B\u044F\u044E\u0442\u0441\u044F \u0447\u0435\u0442\u044B\u0440\u044C\u043C\u044F \u0431\u0430\u0437\u043E\u0432\u044B\u043C\u0438 \u043F\u0435\u0440\u0441\u043F\u0435\u043A\u0442\u0438\u0432\u0430\u043C\u0438 \u043D\u0430 \u0435\u0434\u0438\u043D\u043E\u0435 \u0441\u043E\u0431\u044B\u0442\u0438\u0435 (\u0432 \u044F\u0437\u044B\u043A\u0435 \u043A\u0432\u0430\u0434\u0440\u0430\u043D\u0442\u0430\u043C \u0441\u043E\u043E\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0443\u044E\u0442 \u043F\u0435\u0440\u0441\u043F\u0435\u043A\u0442\u0438\u0432\u044B \u043F\u0435\u0440\u0432\u043E\u0433\u043E \u043B\u0438\u0446\u0430, \u0432\u0442\u043E\u0440\u043E\u0433\u043E \u043B\u0438\u0446\u0430, \u0442\u0440\u0435\u0442\u044C\u0435\u0433\u043E \u043B\u0438\u0446\u0430; \u0442\u0440\u0435\u0442\u044C\u0435 \u043B\u0438\u0446\u043E \u0432 \u0435\u0434\u0438\u043D\u0441\u0442\u0432\u0435\u043D\u043D\u043E\u043C \u0447\u0438\u0441\u043B\u0435 \u0441\u043E\u043E\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0443\u0435\u0442 \u0438\u043D\u0434\u0438\u0432\u0438\u0434\u0443\u0430\u043B\u044C\u043D\u043E\u043C\u0443 \u043E\u0431\u044A\u0435\u043A\u0442\u0438\u0432\u043D\u043E\u043C\u0443 \u043A\u0432\u0430\u0434\u0440\u0430\u043D\u0442\u0443, \u0430 \u0432\u043E \u043C\u043D\u043E\u0436\u0435\u0441\u0442\u0432\u0435\u043D\u043D\u043E\u043C \u0447\u0438\u0441\u043B\u0435\u2009\u2014\u2009\u0441\u0438\u0441\u0442\u0435\u043C\u043D\u043E\u043C\u0443 \u043C\u0435\u0436\u043E\u0431\u044A\u0435\u043A\u0442\u0438\u0432\u043D\u043E\u043C\u0443 \u043A\u0432\u0430\u0434\u0440\u0430\u043D\u0442\u0443).</p><p>AQAL-\u043C\u0430\u0442\u0440\u0438\u0446\u0430 (\u043E\u0441\u043E\u0431\u0435\u043D\u043D\u043E \u043F\u0440\u0438\u043C\u0435\u043D\u0438\u0442\u0435\u043B\u044C\u043D\u043E \u043A \u0441\u0444\u0435\u0440\u0430\u043C \u0438\u043D\u0442\u0435\u0433\u0440\u0430\u043B\u044C\u043D\u043E\u0439 \u043F\u0441\u0438\u0445\u043E\u043B\u043E\u0433\u0438\u0438 \u0438 \u0438\u043D\u0442\u0435\u0433\u0440\u0430\u043B\u044C\u043D\u043E\u0439 \u043F\u0441\u0438\u0445\u043E\u0442\u0435\u0440\u0430\u043F\u0438\u0438) \u0432\u043A\u043B\u044E\u0447\u0430\u0435\u0442 \u0432 \u0441\u0435\u0431\u044F:</p><ul><li>\u0432\u0441\u0435 \u043A\u0432\u0430\u0434\u0440\u0430\u043D\u0442\u044B (\u0447\u0435\u0442\u044B\u0440\u0435 \u043D\u0435\u0441\u0432\u043E\u0434\u0438\u043C\u044B\u0445 \u0434\u0440\u0443\u0433 \u043A \u0434\u0440\u0443\u0433\u0443 \u0438\u0437\u043C\u0435\u0440\u0435\u043D\u0438\u044F \u0440\u0435\u0430\u043B\u044C\u043D\u043E\u0441\u0442\u0438: \u0432\u043D\u0443\u0442\u0440\u0435\u043D\u043D\u0435\u0435 \u0441\u0443\u0431\u044A\u0435\u043A\u0442\u0438\u0432\u043D\u043E\u0435 \u0441\u043E\u0437\u043D\u0430\u043D\u0438\u0435/\u0441\u0430\u043C\u043E\u0441\u0442\u044C\u2009\u2014\u2009\xAB\u044F\xBB-\u043A\u0432\u0430\u0434\u0440\u0430\u043D\u0442; \u0432\u043D\u0443\u0442\u0440\u0435\u043D\u043D\u0430\u044F \u043C\u0435\u0436\u0441\u0443\u0431\u044A\u0435\u043A\u0442\u0438\u0432\u043D\u0430\u044F \u043A\u0443\u043B\u044C\u0442\u0443\u0440\u0430/\u0432\u0437\u0430\u0438\u043C\u043E\u043E\u0442\u043D\u043E\u0448\u0435\u043D\u0438\u044F\u2009\u2014\u2009\xAB\u043C\u044B\xBB-\u043A\u0432\u0430\u0434\u0440\u0430\u043D\u0442; \u0432\u043D\u0435\u0448\u043D\u0438\u0439 \u043E\u0431\u044A\u0435\u043A\u0442\u0438\u0432\u043D\u044B\u0439 \u043C\u043E\u0437\u0433/\u043E\u0440\u0433\u0430\u043D\u0438\u0437\u043C\u2009\u2014\u2009\xAB\u043E\u043D\u043E-\u043A\u0432\u0430\u0434\u0440\u0430\u043D\u0442; \u0432\u043D\u0435\u0448\u043D\u0438\u0435 \u043C\u0435\u0436\u043E\u0431\u044A\u0435\u043A\u0442\u0438\u0432\u043D\u044B\u0435 \u0441\u043E\u0446\u0438\u0430\u043B\u044C\u043D\u044B\u0435 \u0441\u0438\u0441\u0442\u0435\u043C\u044B/\u043E\u043A\u0440\u0443\u0436\u0430\u044E\u0449\u0430\u044F \u0441\u0440\u0435\u0434\u0430\u2009\u2014\u2009\xAB\u043E\u043D\u0438\xBB-\u043A\u0432\u0430\u0434\u0440\u0430\u043D\u0442);</li><li>\u0432\u0441\u0435 \u0443\u0440\u043E\u0432\u043D\u0438\u2009\u2014\u2009\u0438\u043B\u0438 \xAB\u0432\u043E\u043B\u043D\u044B\xBB\u2009\u2014\u2009\u0440\u0430\u0437\u0432\u0438\u0442\u0438\u044F (\u043E\u0442 \u0434\u043E\u0440\u0430\u0446\u0438\u043E\u043D\u0430\u043B\u044C\u043D\u044B\u0445 \u0434\u043E \u0440\u0430\u0446\u0438\u043E\u043D\u0430\u043B\u044C\u043D\u044B\u0445 \u0438 \u043D\u0430\u0434\u0440\u0430\u0446\u0438\u043E\u043D\u0430\u043B\u044C\u043D\u044B\u0445; \u043E\u0442 \u0434\u043E\u043A\u043E\u043D\u0432\u0435\u043D\u0446\u0438\u043E\u043D\u0430\u043B\u044C\u043D\u044B\u0445 \u0434\u043E \u043A\u043E\u043D\u0432\u0435\u043D\u0446\u0438\u043E\u043D\u0430\u043B\u044C\u043D\u044B\u0445 \u0438 \u043F\u043E\u0441\u0442\u043A\u043E\u043D\u0432\u0435\u043D\u0446\u0438\u043E\u043D\u0430\u043B\u044C\u043D\u044B\u0445; \u043E\u0442 \u0442\u0435\u043B\u0430 \u0434\u043E \u0443\u043C\u0430 \u0438 \u0434\u0443\u0445\u0430 \u0438 \u0442. \u0434.\u2009\u2014\u2009\u0441\u043C. \u0442\u0430\u043A\u0436\u0435 \u0438\u0441\u0441\u043B\u0435\u0434\u043E\u0432\u0430\u043D\u0438\u044F \u043F\u0441\u0438\u0445\u043E\u043B\u043E\u0433\u0438\u0438 \u0432\u0437\u0440\u043E\u0441\u043B\u043E\u0433\u043E \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u044F);</li><li>\u0432\u0441\u0435 \u043B\u0438\u043D\u0438\u0438 \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u044F\u2009\u2014\u2009\u0438\u043B\u0438 \xAB\u043F\u043E\u0442\u043E\u043A\u0438\xBB (\u043C\u043D\u043E\u0436\u0435\u0441\u0442\u0432\u0435\u043D\u043D\u044B\u0439 \u0438\u043D\u0442\u0435\u043B\u043B\u0435\u043A\u0442, \u0432\u043A\u043B\u044E\u0447\u0430\u044E\u0449\u0438\u0439 \u0432 \u0441\u0435\u0431\u044F \u043A\u043E\u0433\u043D\u0438\u0442\u0438\u0432\u043D\u044B\u0439 \u0438\u043D\u0442\u0435\u043B\u043B\u0435\u043A\u0442, \u044D\u043C\u043E\u0446\u0438\u043E\u043D\u0430\u043B\u044C\u043D\u044B\u0439 \u0438\u043D\u0442\u0435\u043B\u043B\u0435\u043A\u0442, \u043C\u0435\u0436\u043B\u0438\u0447\u043D\u043E\u0441\u0442\u043D\u044B\u0439 \u0438\u043D\u0442\u0435\u043B\u043B\u0435\u043A\u0442, \u0434\u0443\u0445\u043E\u0432\u043D\u044B\u0439 \u0438\u043D\u0442\u0435\u043B\u043B\u0435\u043A\u0442, \u0441\u043E\u043C\u0430\u0442\u0438\u0447\u0435\u0441\u043A\u0438\u0439 \u0438\u043D\u0442\u0435\u043B\u043B\u0435\u043A\u0442 \u0438 \u0442. \u0434.);</li><li>\u0432\u0441\u0435 \u0441\u043E\u0441\u0442\u043E\u044F\u043D\u0438\u044F \u0441\u043E\u0437\u043D\u0430\u043D\u0438\u044F \u0438 \u0431\u044B\u0442\u0438\u044F (\u0432 \u043A\u043E\u043D\u0442\u0435\u043A\u0441\u0442\u0435 \u0441\u043E\u0437\u043D\u0430\u043D\u0438\u044F \u0440\u0435\u0447\u044C \u043E \u043C\u043D\u043E\u0433\u043E\u043E\u0431\u0440\u0430\u0437\u0438\u0438 \u043E\u0431\u044B\u0447\u043D\u044B\u0445 \u0438 \u043D\u0435\u043E\u0431\u044B\u0447\u043D\u044B\u0445 \u0441\u043E\u0441\u0442\u043E\u044F\u043D\u0438\u0439\u2009\u2014\u2009\u043E\u0442 \u0433\u0440\u0443\u0431\u043E\u0433\u043E \u0434\u043E \u0442\u043E\u043D\u043A\u043E\u0433\u043E, \u043F\u0440\u0438\u0447\u0438\u043D\u043D\u043E\u0433\u043E, \u0441\u0432\u0438\u0434\u0435\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u0443\u044E\u0449\u0435\u0433\u043E \u0438 \u043D\u0435\u0434\u0432\u043E\u0439\u0441\u0442\u0432\u0435\u043D\u043D\u043E\u0433\u043E; \u0432 \u043A\u043E\u043D\u0442\u0435\u043A\u0441\u0442\u0435 \u043C\u043E\u0437\u0433\u0430 \u0438 \u0444\u0438\u0437\u0438\u043E\u043B\u043E\u0433\u0438\u0438 \u044D\u0442\u043E \u0434\u0438\u043D\u0430\u043C\u0438\u043A\u0430 \u0441\u043E\u0441\u0442\u043E\u044F\u043D\u0438\u0439 \u043C\u043E\u0437\u0433\u0430 \u0438 \u0444\u0438\u0437\u0438\u043E\u043B\u043E\u0433\u0438\u0438);</li><li>\u0432\u0441\u0435 \u0442\u0438\u043F\u044B \u043B\u0438\u0447\u043D\u043E\u0441\u0442\u0438 \u0438 \u0441\u043E\u0431\u044B\u0442\u0438\u0439 (\u0432 \u043A\u043E\u043D\u0442\u0435\u043A\u0441\u0442\u0435 \u0447\u0435\u043B\u043E\u0432\u0435\u043A\u0430 \u044D\u0442\u043E \u0440\u0430\u0437\u043B\u0438\u0447\u043D\u044B\u0435 \u0442\u0438\u043F\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0440\u0430\u0437\u043B\u0438\u0447\u0438\u044F, \u0442\u0430\u043A\u0438\u0435 \u043A\u0430\u043A \u043F\u043E\u043B, \u0433\u0435\u043D\u0434\u0435\u0440, \u0442\u0438\u043F \u0445\u0430\u0440\u0430\u043A\u0442\u0435\u0440\u0430 \u0438 \u0442. \u0434.);</li><li>\u0438 \u0441\u0430\u043C\u043E\u0441\u0442\u044C (\u0442\u043E, \u0447\u0442\u043E \u0432\u044B\u043F\u043E\u043B\u043D\u044F\u0435\u0442 \u043D\u0430\u0432\u0438\u0433\u0430\u0446\u0438\u044E \u0447\u0435\u0440\u0435\u0437 \u0432\u0441\u0435 \u044D\u0442\u0438 \u0440\u0430\u0437\u043B\u0438\u0447\u043D\u044B\u0435 \u0444\u0430\u043A\u0442\u043E\u0440\u044B, \u0440\u0430\u0441\u0442\u0451\u0442 \u0438 \u0440\u0430\u0437\u0432\u0438\u0432\u0430\u0435\u0442\u0441\u044F \u0447\u0435\u0440\u0435\u0437 \u043D\u0438\u0445 \u0438 \u043E\u0441\u043C\u044B\u0441\u043B\u044F\u0435\u0442 \u0438\u0445).</li></ul>',9),A=[s];function p(_,n,r,o,c,d){return a(),l("div",null,A)}var h=e(i,[["render",p]]);export{Q as __pageData,h as default};
